import * as React from 'react'
import { allTaxa, Taxa, TaxonCode } from './alltaxa'

interface ScoringTaxonToPrint {
	code:     TaxonCode,
	codeName: string,
	name:     string,
	scoreStr: string,
}

const printTaxa = (name:string, taxa: ScoringTaxonToPrint[]) => (
	<div><h2>{name}</h2>
		<h3>Confirm correct</h3> {
			taxa.map((tx) => {
				return <p key={tx.code}>
					{`${tx.name} => ${tx.code} => ${tx.codeName}`}
				</p>
			})
		}

		<h3>New format</h3> {
			taxa.map((tx) => (
				<p>{`[ "${tx.code}", { ${tx.scoreStr} } ],   // ${tx.codeName}`}</p>
			))
		}
	</div>
)

